import logo from './divumimages.png';
import './App.css';
import React from 'react'; 

function App() {
  return (
    <div className="main_layout">
     <div className="header"> <img src={logo} className="App-logo" alt="logo" />
      <div className="headerbutton"><button >Add+</button></div></div>
    </div>
  );
}

export default App;
